## Descrição

Script relacionado a issue #87, onde o objetivo é criar um script que faça a análise anual e mensal do Crédito Suplementar de cada município.

### Alterações

Alteração no formato do JSON exportado para se adequar ao Front-end;
Adição dos dados dos municípios em um só arquivo para facilitar sua exposição;
Código responsável por somar os valores anuais e mensais.


## Critérios de Aceitação

- [ ] Script comentado.
- [ ] Script refatorado com retorno da função;
- [ ] Arquivo de saída seguindo o modelo apresentado pela equipe do Front-end.
